import React, { useState } from 'react';
import './UserSign.css';
import { Link } from 'react-router-dom/cjs/react-router-dom.min';

const UserSignup = () => {
  const [stack, setStack] = useState([]); // Stack to store user data
  const [formData, setFormData] = useState({
    name: '',
    mobile: '',
    email: '',
    password: ''
  });

  // Handle form input changes
  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault(); // Prevent default form submission
    setStack([...stack, formData]); // Push form data onto the stack
    console.log('Stack:', stack); // View the stack in the console
    alert('User data added to the stack!');
    // Optionally, clear form inputs after submission
    setFormData({ name: '', mobile: '', email: '', password: '' });
  };

  return (
    <div className="Main">
      <span className="h1">Sign In</span>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          name="name"
          className="mt-4 form-control name"
          placeholder="Your Name"
          value={formData.name}
          onChange={handleChange}
        />
        <input
          type="tel"
          name="mobile"
          className="mt-2 form-control name"
          placeholder="Your Mobile Number"
          value={formData.mobile}
          onChange={handleChange}
        />
        <input
          type="email"
          name="email"
          className="mt-2 form-control"
          placeholder="Your Email"
          value={formData.email}
          onChange={handleChange}
        />
        <input
          type="password"
          name="password"
          className="mt-2 form-control"
          placeholder="Your Password"
          value={formData.password}
          onChange={handleChange}
        />
        <br />
        <input type="submit" className="mb-2 btn btn-light mt-2" value="Sign In" />
        <small>
          Already have an account?{' '}
          <Link to="/User-Login" className="text-warning">
            Login
          </Link>
        </small>
      </form>
    </div>
  );
};

export default UserSignup;
